import React from 'react';
import {Link} from 'react-router-dom';

const Navbar = () => {
    return (
        <section className="navbar">
            <Link to="/"><span  className="mainInfo">HOME</span></Link>
            <Link to="/community"><span className="community">Community</span></Link>
            <Link to="/mypage"><span  className="mypage">MyPage</span></Link>
        </section>
    )
}

export default Navbar;
